import Card from "../card/card.js"
import "./trending.css"


const Trending = ({trendingNfts}) => {
    const trending = Promise.all(trendingNfts)
    console.log(trending)
    const displayArray = trendingNfts.map((obj,i) => {
        const newObj = obj.then(response => response.data)
        console.log(newObj)
        return <Card
                key={newObj.id}
                title={newObj.name}
            />        
    })

    return(
        <div className="trending">
                {displayArray}
        </div>
    )
}

export default Trending;
